import React, { useState } from 'react'
import Button from './components/Button';

function App() {

  const [digits, setDigits] = useState(0);

  const numbers = [{
    number: 7, 
    numWord: "seven"
  },
  { number: 8, 
    numWord: "seven"
  },
  { number: 9, 
    numWord: "nine"
  },
  { number: 4, 
    numWord: "four"
  },
  { number: 5, 
    numWord: "five"
  },
  { number: 6, 
    numWord: "six"
  },
  { number: 3, 
    numWord: "six"
  },
  { number: 2, 
    numWord: "six"
  },
  { number: 1, 
    numWord: "six"
  },
  { number: 0,
    numWord: "zero"
  }

];
  const makeButtons = numbers.map(number => (
    <Button number={number.number} value={number.numWord} class="number" onClick={number.number}/>
  ))

  return (
    <div className="App">
      <input type="text" class="total">{digits}</input>
      {makeButtons}
    </div>
  );
}

export default App;
